import React from "react";

class FetchProduct extends React.Component {
  state = {
    loading: true,
    product: null
  };

  async componentDidMount() {
    const url = "/admin/api/2020-01/products.json";
    const response = await fetch(url);
    const data = await response.json();
    this.setState({ product: data.products[0], loading: false });
  }

  render() {
    if (this.state.loading) {
      return <div>loading...</div>;
    }

    if (!this.state.product) {
      return <div>didn't get a product</div>;
    }

    return (
      <div>
        <div>{this.state.product.vendor}</div>
        //<div>{this.state.product.name.first}</div>
        //<div>{this.state.person.name.last}</div>
        //<img src={this.state.person.picture.large} />
      </div>
    );
  }
};
export default FetchProduct;
